import React, { useState } from 'react';
import { createLink } from '@meshconnect/web-link-sdk';

const OpenLink = () => {
  const [iFrameUrl, setIFrameUrl] = useState(null);

  const fetchData = async () => {
    try {
      const response = await fetch('http://localhost:3000/api/getCatalogLink', {
        method: 'GET',
        headers: {
          'Accept': 'application/json',
          'Content-Type': 'application/json',
        },
      });

      if (!response.ok) {
        throw new Error('Network response error');
      }

      const result = await response.json();
      setIFrameUrl(result.iFrameUrl);
    } catch (error) {
      console.error('Error fetching the API', error);
    }
  };

  // Fetch data on component mount
  useEffect(() => {
    fetchData();
  }, []);

  return (
    <div>
      {iFrameUrl ? (
        <div>
          <h3>Catalog Link success</h3>
          <p style={{ whiteSpace: 'pre-wrap' }}>Catalog IFrame URL: {iFrameUrl}</p>
          <iframe src={iFrameUrl} style={{ width: '100%', height: '600px', border: 'none' }} />
        </div>
      ) : (
        <div>Loading...</div>
      )}
    </div>
  );
};

export default OpenLink;
